a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\\\"<\\/p>\",\"blog_image\":\"621ca6983ca221646044824.jpg\"}', '2020-12-01 01:16:46', '2022-02-28 04:40:24'),
