INSERT INTO `support_messages` (`id`, `supportticket_id`, `admin_id`, `message`, `created_at`, `updated_at`) VALUES
(1, '1', 0, 'Mohon bantuan verifikasi data saya atas nama Ali mashari dengan Email 411mashari@gmail.com', '2022-08-28 13:58:11', '2022-08-28 13:58:11'),
(2, '1', 1, 'Selamat malam, \r\n\r\nKami cek untuk email 411mashari@gmail.com sudah berstatus Verified. Silahkan dicek kembali dengan melakukan login kembali (https://microgold.fund/login).', '2022-08-28 14:07:03', '2022-08-28 14:07:03'),
(3, '1', 0, 'untuk email sudah kak. yang belum data diri. saya sertakan filenya', '2022-08-28 14:12:33', '2022-08-28 14:12:33'),
(4, '1', 1, 'Akun KYC sudah diverifikasi ya', '2022-08-28 17:20:11', '2022-08-28 17:20:11'),
(5, '2', 0, 'saya sudah melakukan purchase plan testing pertama untuk kaki kanan , tetapi belum bisa melakukan purchase berikutnya untuk kaki kiri', '2022-08-29 00:48:46', '2022-08-29 00:48:46'),
(6, '2', 1, 'Salam pak Nugrahono, saat ini platform hanya dibuka satu kali purchased saja, karena Management sedang mensetup First Line Leader Microgold. Apakah yang di ingin di reset kembali pak ?, jika Ya kami akan melakukan proses reset kembali. Terimakasih', '2022-08-29 01:16:41', '2022-08-29 01:16:41'),
(7, '3', 0, 'Utk kuota 100 org pertama mendapatkan 99pcs dimana barang yg didapatkan totalnya memang hanya senilai 2.207.000 yaa, bukan senilai 2.890.000?\r\n\r\nSedangkan setelah 100 org pertama mendapatkan 77pcs dimana barang yg didapatkan totalnya hanya senilai 1.801.000 yaa?\r\n\r\nMengapa barang yg didapatkan tidak senilai uang yg kita keluarkan?\r\n\r\nTerima kasih', '2022-08-29 02:35:22', '2022-08-29 02:35:22'),
(8, '4', 0, 'refered by kosong', '2022-08-29 02:48:51', '2022-08-29 02:48:51'),
(9, '5', 0, 'Mohon infonya, kenapa referred by saya yg paling atas a.n Ade Suherman masih kosong, blm muncul Firstline Microgold nya?', '2022-08-29 02:55:04', '2022-08-29 02:55:04'),
(10, '6', 0, 'Maksud dari capturean yg saya kirim apa yah kak? apakah saya harus bayar itu semua?', '2022-08-29 03:06:24', '2022-08-29 03:06:24'),
(11, '7', 0, 'Assalamualaikum, mau tanya, kenapa saya tidak bisa membeli paket lagi ya, untuk ngisih sayap sebelah kiri saya, mohon di bantu kk, apakah sedang dlm proses?', '2022-08-29 03:11:38', '2022-08-29 03:11:38'),
(12, '8', 0, 'Mohon bantu cek, apakah pengisian BRO REFERAL sy sdh benar? Sepertinya tadi ada ke-skip di penempatan.', '2022-08-29 03:49:42', '2022-08-29 03:49:42'),
(13, '9', 0, 'Bagiaman membuat kaki kanan, stelah but kakai kirai di tree, menu membuat kaki tidak ada', '2022-08-29 03:58:26', '2022-08-29 03:58:26'),
(14, '10', 0, 'Mohon izin bertanya, apakah ini harus subcribe dulu yaa pak? Dan untuk selection position boleh diset salah satu ataupun boleh dua nya ya pak? ', '2022-08-29 04:54:16', '2022-08-29 04:54:16'),
(15, '6', 1, 'Itu log investasi/riwayat investasi kak', '2022-08-29 04:58:18', '2022-08-29 04:58:18'),
(16, '7', 1, 'Ya memang untuk pembelian paket membership hanya bisa satu kali untuk satu user kak', '2022-08-29 05:06:15', '2022-08-29 05:06:15'),
(17, '9', 1, 'Untuk mendapatkan Custom Tree yang bisa di menempatkan kaki sesuasi keinginan kakak, kakak harus subscribe dengan jumlah BRO lebih dari 1, jadi misal kakak subscribe membership sebesar 5 BRO, maka kakak akan dapat 4 BRO dengan penempatan sesuai keinginan kakak. Atau dengan cara lain jika kakak sudah terlanjur subscribe membership, kakak bisa undang teman atau kerabat kakak dengan memasukan nomor BRO kakak sebelum melakukan subscribe membership dan memilih posisi sesuai keinginan kakak', '2022-08-29 05:12:05', '2022-08-29 05:12:05'),
(18, '8', 1, 'Sudah benar kak', '2022-08-29 05:12:31', '2022-08-29 05:12:31'),
(19, '10', 1, 'Ya harus subscribe terlebih dahulu, untuk penempatan posisi pilih salah satu ya kak, kanan atau kiri', '2022-08-29 05:13:26', '2022-08-29 05:13:26'),
(20, '5', 1, 'Sudah ya kak, coba cek lagi', '2022-08-29 05:20:22', '2022-08-29 05:20:22'),
(21, '4', 1, 'Sudah ya kak, coba cek lagi', '2022-08-29 05:22:53', '2022-08-29 05:22:53'),
(23, '11', 0, 'bagaimana cara meambah anggota baru', '2022-08-29 07:15:25', '2022-08-29 07:15:25'),
(24, '12', 0, 'Selamat siang,\r\nMau tanya untuk pembelian pertama member sebesar Rp. 2.890.000 itu mendapatkan paket emas senilai 1.801.000\r\nBerarti ada membership fee senilai Rp. 1jt didepan ya?\r\n\r\nJd privilage nya member itu selain selisih harga 3rb per koin dan fee dr kak', '2022-08-29 07:39:54', '2022-08-29 07:39:54'),
(25, '13', 0, 'Selamat siang,\r\nMau tanya untuk pembelian pertama member sebesar Rp. 2.890.000 itu mendapatkan paket emas senilai 1.801.000\r\nBerarti ada membership fee senilai Rp. 1jt didepan ya?\r\n\r\nJd privilage nya member itu selain selisih harga 3rb per koin dan fee dr kaki apa?', '2022-08-29 07:40:43', '2022-08-29 07:40:43'),
(26, '14', 0, 'Ini langkah awal selanjutnya gimana ?', '2022-08-29 10:55:34', '2022-08-29 10:55:34'),
(27, '15', 0, 'Saya sudah dapat 1 BRO \r\nterus saya sellanjutnya gimana \r\napa yang saya klik dan seterusnya \r\n\r\nbahasa MLM saya nddak begitu paham \r\n\r\nseperti gambar \r\nsaya harus gimana', '2022-08-29 11:07:08', '2022-08-29 11:07:08'),
(28, '16', 0, '@MicroGOld Satrya \r\n- apakah ada contoh bahan promosi produk\r\n- jika kita mau melakukan penjualan dalam bentuk fisiknya ke dinaran, pengirimannya tujuan kemana\r\n- jika ada calon pembeli kita yg berbeda kota dg kita, pengirimannya ke alamat kita atau ke alamat calon konsumen', '2022-08-30 03:43:39', '2022-08-30 03:43:39'),
(29, '17', 0, 'Calon member telah melalui verivikasi ... dah ke 3 \r\nmau subcride .. teretulis INSUFICIEJNT BALANCE', '2022-08-30 11:01:55', '2022-08-30 11:01:55'),
(30, '18', 0, 'Mohon dibantu ya.\r\nDownline saya tidak bisa subscribber.\r\nLangkah apa yg harus saya lakukan ?', '2022-08-30 12:36:16', '2022-08-30 12:36:16'),
(31, '18', 1, 'Selamat pagi bu Nevyta, untuk downline silahkan diminta untuk Deposit terlebih dahulu kemudian apabila sudah di Approve admin dan balance sudah terisi maka downline bisa melakukan purchase plan BRO di menu Plan dengan melakukan input BRO Number milik bu Nevyta. Semoga membantu', '2022-08-31 01:13:24', '2022-08-31 01:13:24'),
